import React, { useState } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faHeart,
  faCartShopping,
  faMagnifyingGlass,
} from "@fortawesome/free-solid-svg-icons";
import { useSelector } from "react-redux";
import { Link } from "react-router-dom";

const Navbar = () => {
  const [query, setQuery] = useState("");
  const selector = useSelector((state) => state.product.products);
  const favouriteSelect = useSelector((state) => state.favouriteItem.favouriteProduct);

  const handleSearch = (e) => {
    const query = e.target.value.toLowerCase();
    setQuery(query);
  };

  // Filter products based on the search query
  const filteredProducts = selector.filter((item) =>
    item.title.toLowerCase().includes(query)
  );

  return (
    <div>
      <nav className="bg-white border-gray-200 border">
        <div className="max-w-screen-xl flex flex-wrap items-center justify-between mx-auto p-4">
          <a href="https://flowbite.com" className="flex items-center">
            <span className="self-center text-2xl font-semibold whitespace-nowrap">
              Exclusive
            </span>
          </a>
          <div className="flex md:order-2">
            <button
              type="button"
              data-collapse-toggle="navbar-search"
              aria-controls="navbar-search"
              aria-expanded="false"
              className="md:hidden hover-bg-gray-100 dark:hover-bg-gray-700 focus-outline-none focus-ring-4 focus-ring-gray-200 dark:focus-ring-gray-700 rounded-lg text-sm p-2.5 mr-1"
            >
              <span className="sr-only">Search</span>
            </button>
            <div className="relative hidden md:block">
              <div className="absolute inset-y-0 left-0 flex items-center pl-3 pointer-events-none">
                <button>
                  <FontAwesomeIcon icon={faMagnifyingGlass} />
                </button>
              </div>
              <input
                type="text"
                id="search-navbar"
                className="block w-full p-2 pl-10 text-sm rounded-lg focus-ring-blue-500 focus-border-blue-500 dark-bg-gray-700 dark-border-gray-600 dark-placeholder-gray-400 dark-text-white dark-focus-ring-blue-500 dark-focus-border-blue-500"
                placeholder="Search..."
                value={query}
                onChange={(e) => handleSearch(e)}
              />
            </div>
            <div className="mx-4 mt-3 flex">
              <FontAwesomeIcon className="" icon={faHeart} />
              {favouriteSelect.length}
              <Link to="/cart" className="flex">
                <FontAwesomeIcon className="ms-3" icon={faCartShopping} />
                <p>{selector.length}</p>
              </Link>
            </div>
          </div>
          <div className="items-center justify-between hidden w-full md:flex md:w-auto md:order-1" id="navbar-search">
            <div className="relative mt-3 md:hidden">
              <div className="absolute inset-y-0 left-0 flex items-center pl-3 pointer-events-none">
                <svg
                  className="w-4 h-4 text-gray-500 dark:text-gray-400"
                  aria-hidden="true"
                  xmlns="http://www.w3.org/2000/svg"
                  fill="none"
                  viewBox="0 0 20 20"
                >
                  <path
                    stroke="currentColor"
                    stroke-linecap="round"
                    stroke-linejoin="round"
                    stroke-width="2"
                    d="m19 19-4-4m0-7A7 7 0 1 1 1 8a7 7 0 0 1 14 0Z"
                  />
                </svg>
              </div>
              <input
                type="text"
                id="search-navbar"
                className="block w-full p-2 pl-10 text-sm border border-gray-300 rounded-lg bg-gray-50 focus-ring-blue-500 focus-border-blue-500 dark-bg-gray-700 dark-border-gray-600 dark-placeholder-gray-400 dark-text-white dark-focus-ring-blue-500 dark-focus-border-blue-500"
                placeholder="Search..."
              />
            </div>
          </div>
        </div>
      </nav>
      <div className="max-w-screen-xl mx-auto p-4">
        <div>
          {filteredProducts.length > 0 ? ( // Display products when there are matching results
            <ul>
              {filteredProducts.map((product) => (
                <li key={product.id}>{product.title}</li>
              ))}
            </ul>
          ) : (
            <p>No matching results.</p> // Display a message when there are no matching results
          )}
        </div>
      </div>
    </div>
  );
};

export default Navbar;
